    false,nt"url": null,nt"notes": "This workshop was held at the Agassiz National
    Wildlife Refuge, August 25-27, 1964; it had two objectives: 1 To explain the purpose
    of the dewline banding project and the procedures associated with banding. 2. Demonstrate
    techniques for waterfowl identification; aging and sexing, and the use of cannon
    net traps and bait traps. The participants were queried. 60 days after the sessions
    to learn what direct application of techniques and principles had been made and
    what benefits had resulted. In all cases, participants intended to apply one or
    more techniques to 1965 banding projects.",nt"license_title": "License Not
